import React from 'react';
// TODO: import useFormik from formik library
import {useFormik} from 'formik'
function App() {
  // TODO: add a const called formik assigned to useFormik()
  const formik = useFormik({
    initialValues: {
      email: '',
      password: ''
    } 
  })

  return (
    <div>
      <form>
        <div>Email</div>
        <input id='emailField' type='text'/>
        <div>Password</div>

      </form>
    </div>
  );
}

export default App;
